    _success = json['success'];
    _message = json['message'];
    if (json['data'] != null) {
      _data = [];
      json['data'].forEach((v) {
        _data?.add(ChatResponseData.fromJson(v));
      });
    }
    _totalRecords = json['totalRecords'];
  }

  bool? _success;
  String? _message;
  List<ChatResponseData>? _data;
  dynamic _totalRecords;

  bool? get success => _success;

  String? get message => _message;

  List<ChatResponseData>? get data => _data;

  dynamic get totalRecords => _totalRecords;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['success'] = _success;
    map['message'] = _message;
    if (_data != null) {
      map['data'] = _data?.map((v) => v.toJson()).toList();
    }
    map['totalRecords'] = _totalRecords;
    return map;
  }
